import React from "react";
import "../DscUp/dscup.css";

const DscUp = () => {
  return (
    <div className="upload-container">
      <h1>DSC Video Verification</h1>
      <p>
        Follow these steps carefully to complete your <strong>DSC Video Verification</strong>:
      </p>
      <ol className="verification-steps">
        <li><strong>Step 1:</strong> Record a clear video in a well-lit environment.</li>
        <li><strong>Step 2:</strong> Ensure your <strong>face and government-issued ID</strong> are clearly visible.</li>
        <li><strong>Step 3:</strong> Clearly state your <strong>full name</strong> and <strong>DSC details</strong> at the start of the video.</li>
        <li><strong>Step 4:</strong> Once recorded, <strong>contact our support team</strong> to submit your video for verification.</li>
      </ol>
      <p>
        Need a DSC?{" "}
        <a
          href="https://certificate.pantasign.com/Account/SignUp"
          target="_blank"
          rel="noopener noreferrer"
        >
          <strong>Sign up here</strong>
        </a>.
      </p>
      <p>
        For assistance, please reach out to our <strong>support team</strong>.
      </p>
    </div>
  );
};

export default DscUp;
